import "./IncExpView.css";
const IncExpView = (inc) => {
  //   const [inc, setinc] = useState([
  //     {
  //       name: "salary",
  //       amount: 500,
  //     },
  //     {
  //       name: "bonus",
  //       amount: 50,
  //     },
  //   ]);
  return (
    <div className="inc-exp">
      <div className="inc-container">
        <h2>Income</h2>
        <br />
        {inc.reduce((total, totalinc) => (total = total + totalinc.amount), 0)}
        <h2 className="inc">+£0.00</h2>
      </div>

      <div className="exp-container">
        <h2>Expenses</h2>
        <br />
        <h2 className="exp">-£0.00</h2>
      </div>
    </div>
  );
};
export default IncExpView;
